import styled from '@emotion/styled';

export default styled.div`
    display: flex;
    align-items: center;
    width: 63%;
    justify-content: center;

    .layout-nav-element {
        margin-right: 3.5em;

        &:last-of-type {
            margin-right: 0%;
        }
    }
`;
